styles.content:
@media only screen and (max-width: 600px) {
  self{
    display: none !important;
  }
}

self .FdVirtualGrid {
	cursor:default;
}


self .FdVirtualGrid > div .selected .statusMatrixItem  { 
	background-color: rgb(46, 89, 189) !important; 
	color: #FFFFFF !important;
	/* box-shadow: rgba(0, 0, 0, 0.35) 0px 5px 15px; */
}

@media only screen and (max-width: 600px) {
	self {
		width: 90%;
	}
}

self {
	width: 75%;
	max-width: 910px;
}

self {
	font-size: 19px;
}
@media only screen and (max-width: 600px) {
	self {
		font-size: 3.5vw !important;
	}
}

self {
	font-size: 16px;
}
@media only screen and (max-width: 600px) {
	self {
		font-size: 3vw !important;
	}
}

self:has(span[title="onSite"]){
	background-color: #E4F1FC !important;
	color: #5FB2F9;
}
self:has(span[title="remote"]){
	background-color: #E2F5F5  !important;
	color: #5BBDBD;
}
self:has(span[title="vacay"]){
	background-color: #FAEEE0  !important;
	color: #F5A653;
}
self:has(span[title="sick"]){
	background-color: #F8E8EB  !important;
	color: #EB7C90;
}
self:has(span[title="bloqued"]){
	cursor:not-allowed;
	color:#444444;
	background: repeating-linear-gradient(
	-45deg,
	#F1F6F9,
	#F1F6F9 10px,
	#FFFFFF 10px,
	#FFFFFF 20px
	);
}

@media only screen and (min-width: 600px) {
  self{
    display: none !important;
  }
}

@media screen and (max-width: 920px) {
		self {
			font-size: 12px;
			width: 100%;
			height: 35px;
		}
	}

@media screen and (max-width: 1450px) {
		self {
			font-size: 16px;
			width: 140px;
			height: 40px;
		}
	}

self {
	font-size: 22px;
	width: 170px;
	height: 47px;
	cursor: pointer;
}

self:has(span[title="onSite"]){
	background-color: #E4F1FC;
	color: #5FB2F9;
}

self:has(span[title="onSite"]) .fd-icon:before{
	content:"\f041";
	font: normal normal normal 14px/1 FontAwesome;
	display: inline-block;
    font-size: inherit;
    text-rendering: auto;
    -webkit-font-smoothing: antialiased;
}

self:has(span[title="remote"]){
	background-color: #E2F5F5;
	color: #5BBDBD;
}

self:has(span[title="remote"]) .fd-icon:before{
	content:"\f03d";
	font: normal normal normal 14px/1 FontAwesome;
	display: inline-block;
    font-size: inherit;
    text-rendering: auto;
    -webkit-font-smoothing: antialiased;
}

self:has(span[title="vacay"]){
	background-color: #FAEEE0;
	color: #F5A653;
}

self:has(span[title="vacay"]) .fd-icon:before{
	content:"\f072";
	font: normal normal normal 14px/1 FontAwesome;
	display: inline-block;
    font-size: inherit;
    text-rendering: auto;
    -webkit-font-smoothing: antialiased;
}

self:has(span[title="sick"]){
	background-color: #F8E8EB;
	color: #EB7C90;
}

self:has(span[title="sick"]) .fd-icon:before{
	content:"\f0f1";
	font: normal normal normal 14px/1 FontAwesome;
	display: inline-block;
    font-size: inherit;
    text-rendering: auto;
    -webkit-font-smoothing: antialiased;
}

@media screen and (max-width: 1010px) {
		self {
			display: flex;
			flex-direction: column;
			gap: 10px;
		}
	}

self {
	display: flex;
	flex-direction: row;
}
